import React from 'react';
import './UserForm.css'

const UserForm = () => {
    return (
        <div className='userform'>
            <form>
                <label htmlFor='name'>Name</label>
                <input type='text' id='name'/>
                <label htmlFor='age'>Name</label>
                <input type='number' id='age'/>
            </form>
        </div>
    );
};

export default UserForm;
